import React, { useState } from 'react'
import { singleArray } from './singleArray'
import { Link } from 'react-router-dom'
const styles = {
    padding: "10px",
    margin: "5px",
    background: "gold",
    width: "100px",
    height: "100px",
    display: "inline-block"
  };
function FilterPage() {
    let Data = ["all", "dog", "cat"]
    const [filter, setFilter] = useState("all")
    const filterTage = (val) => {
        setFilter(val)
    }
    return (
        <React.Fragment>
            <div style={{ margin: "10px" }}>
                <button onClick={() => setFilter("all")}>All</button>
                <button onClick={() => setFilter("dog")}>dog</button>
                <button onClick={() => setFilter("cat")}>cat</button>
                <button onClick={() => setFilter("lizard")}>lizard</button>
            </div>
            <ul className="list-unstyled templatemo-accordion cat_list " >
                <li className="pb-3" filter={filter} setFilter={filterTage}>
                    <Link className="accordion-collapse collapse d-flex justify-content-between h3 text-decoration-none" to="/">
                        Categories-1
                    </Link>
                </li>
                {
                    Data.map((item) => {
                        return (
                            filter === item || filter === "all" ? (
                                <>
                                    {item}
                                </>
                            ) : null
                        )
                    })
                }
                {/* <li className="pb-3" >
                    <Link className="accordion-collapse collapse d-flex justify-content-between h3 text-decoration-none" to="/">
                        Categories-2
                    </Link>
                </li>
                <li className="pb-3">
                    <Link className="accordion-collapse collapse d-flex justify-content-between h3 text-decoration-none" to="/">
                        Categories-3
                    </Link>
                </li> */}
            </ul>
        </React.Fragment>
    )
}

export default FilterPage
